style.css:
@-moz-document url-prefix("https://discord.com") 
/* vietnamese */
 {
    @font-face {
         font-family: 'VT323';
         font-style: normal;
         font-weight: 400;
         src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isQFJXGdg.woff2) format('woff2');
         unicode-range: U+0102-0103, U+0110-0111, U+0128-0129, U+0168-0169, U+01A0-01A1, U+01AF-01B0, U+0300-0301, U+0303-0304, U+0308-0309, U+0323, U+0329, U+1EA0-1EF9, U+20AB;
    }
    /* latin-ext */
     @font-face {
         font-family: 'VT323';
         font-style: normal;
         font-weight: 400;
         src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isRFJXGdg.woff2) format('woff2');
         unicode-range: U+0100-02AF, U+0304, U+0308, U+0329, U+1E00-1E9F, U+1EF2-1EFF, U+2020, U+20A0-20AB, U+20AD-20CF, U+2113, U+2C60-2C7F, U+A720-A7FF;
    }
    /* latin */
     @font-face {
         font-family: 'VT323';
         font-style: normal;
         font-weight: 400;
         src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isfFJU.woff2) format('woff2');
         unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+0304, U+0308, U+0329, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
    }
    /* ------BACKGROUND------ */
     body {
         background: url("https://cdn.discordapp.com/attachments/1072086469541363714/1076518032924487680/needy-girl-overdose-needy-streamer-overload.gif");
         background-size: cover;
        /*---font---*/
         font-family: "VT323", sans-serif;
    }
     .appMount-2yBXZl, body, .theme-dark .container-2cd8Mz, .applicationStore-2nk7Lo {
         background-color: #f34eb87d!important;
    }
    /* ------REMOVE GREY/WHITE BG COLORS------ */
     .theme-dark, .theme-light {
         -header-primary: #fff;
         -header-secondary: #fff;
         -text-normal: #fff;
         -text-muted: #fff;
         -channels-default: #fff;
         -interactive-normal: #fff;
         -interactive-hover: #fff;
         -interactive-active: #fff;
         -interactive-muted: #fff;
         -background-primary: transparent;
         -background-secondary: transparent;
         -background-secondary-alt: transparent;
         -background-tertiary: transparent;
         -background-floating: rgba(0, 0, 0, .8);
         -channeltextarea-background: transparent;
         -deprecated-panel-background: transparent;
         -background-modifier-hover: rgba(0, 0, 0, .42);
         -background-modifier-selected: rgba(0, 0, 0, .45);
    }
    /* ------POP-UP------ */
     .modal-yWgWj-, .footer-3rDWdC {
         background: rgba(0, 0, 0, .5) !important;
    }
    /*remove borders*/
     .header-2o-2hj, .searchBar-6Kv8R2, .content-yTz4x3::before {
         box-shadow: none !important;
    }
    /*misc*/
     .container-1D34oG, 
    /*friends list*/
     .scrollbar-2rkZSL, 
    /*scrollbar*/
     .pad-29zQak, .track-1JN30G {
         background: transparent !important;
    }
    /* ------SCROLLBAR------ */
     .scrollbar-2rkZSL {
         width: 8px;
    }
     .thumb-2JwNFC {
         background: rgba(0, 0, 0, .5) !important;
    }
     .track-1JN30G, .thumb-2JwNFC {
         border: none !important;
    }
    /* ------EMBEDDED TEXT------ */
     .embedProvider-3k5pfl, .embedDescription-1Cuq9a, .embedFields-2IPs5Z, .embedAuthorName-3mnTWj, .embedFooterText-28V_Wb {
         color: #f2f2f2 !important;
    }
     .cozy-3raOZG .messageContent-2qWWxC, .compact-T3H92H .header-23xsNx .username-1A8OIy, .cozy-3raOZG .header-23xsNx .username-1A8OIy {
         text-shadow: 0 0 20px black;
    }
     }
